import React from 'react';
import { View, Text } from 'react-native';

// Suponha que você tenha uma variável de estado para armazenar os dados do usuário
const usuario = {
  nome: 'John Doe',
  email: 'johndoe@example.com',
  idade: 30,
  cidade: 'New York',
};

const ProfileScreen = () => (
  <View style={{ flex: 1, backgroundColor: '#77BECF' }}>
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Nome: {usuario.nome}</Text>
      <Text>Email: {usuario.email}</Text>
      <Text>Idade: {usuario.idade}</Text>
      <Text>Cidade: {usuario.cidade}</Text>
    </View>
    <View style={{ backgroundColor: '#FFFFFF', borderTopLeftRadius: 20, borderTopRightRadius: 20 }}>
      <View style={{ backgroundColor: '#77BECF', height: '80%', borderTopLeftRadius: 20, borderTopRightRadius: 20 }} />
    </View>
  </View>
);

export default ProfileScreen;
